  false,\n\t\"url\": null,\n\t\"notes\": \"This Wildlife Inventory Plan for Ottawa
  NWR describes the inventory programu2019s relation to Refuge objectives and outlines
  the programu2019s policies and administration. Maps are given of inventory routes,
  muskrat habitat, and Cedar Point NWR. Equipment use and manpower requirements are
  provided in the next section. Inventory procedures are listed for whistling swans,
  geese, ducks, coots, marsh birds, water birds, shorebirds, migratory birds, raptors,
  upland game birds, big game, furbearers, and small mammals.\",\n\t\"owner_org\":
